  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Calhoun National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1952. The report begins by summarizing the weather conditions, water conditions,
  and food and cover during this period. Wildlife including migratory birds, furbearers,
  raptors, and fish is also covered. The Refuge development and maintenance section
  discusses plantings. Resource management is outlined; topics include commercial
  fishing. The public relations section of the report describes recreational uses,
  Refuge visitors, Refuge participation, hunting, fishing, and violations. NR forms
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
